import React from "react";
import { useParams } from "react-router";
import { useWishCartContext } from "../../context/WishCartContext";

export const ProductDetail = () => {
  const { id } = useParams();
  //   console.log(id);
  const {
    state: { products },
  } = useWishCartContext();
  const {
    name,
    price,
    images: { img_1, img_2 },
    inStock,
    intro,
    summary,
    description,
    category,
    additionalInfo,
    fastDelivery,
  } = products?.find((item) => item.id === Number(id));
  return (
    <>
      <div className="container">
        <div className="grid">
          <h1>{name}</h1>
        </div>
      </div>
    </>
  );
};
